Schnorchel-Set 1 Paar Flossen, Schnorchel und Taucherbrille. Flossen größenverstellbar. Taucherbrille in Einheitsgröße mit durchgehender Scheibe aus Sicherheitsglas. Aus Kunststoff. Mund- und Nasenstück sowie Verstellriemen aus Silikon. Inkl. Mesh-Aufbewahrungsbeutel. 4-teilig.

Maße (L x B x H): Set im Beutel: Ca. 63,5 x 30 x 10 cm; Schnorchel: Länge ca. 44 cm; Brille: Ca. 17,5 x 9,5 x 6 cm;  
Klein: Gr. 37–41: Flosse: Ca. 53 x 20,5 cm;  
Groß: Gr. 42–47: Flosse: Ca. 58,5 x 20,5 cm

Farbe: Blau/Schwarz
